import React, { useState } from 'react'

export async function getStaticProps() {
    const res = await fetch('https://pokeapi.co/api/v2/pokemon/?offset=0&limit=841')
    const data = await res.json()
    return {
        props: {
            pokedex: data.results
        }
    }
}

const Home = ({ pokedex }) => {

    const [perPage] = useState(18)

    return (
        <section className="pokedex">
            {pokedex.map(pokemon => (
                <div>
                    {pokemon.name}
                </div>
            ))}
        </section>
    )
}

export default Home
